import{_ as a,o as e,c as t,O as r}from"./chunks/framework.9482e208.js";const y=JSON.parse('{"title":"§ 33.2-220 Transfer of interest in and control over certain highways, highway rights-of-way, and landings.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-220.md","filePath":"vacode/33.2-220.md"}'),i={name:"vacode/33.2-220.md"},n=r('<h1 id="§-33-2-220-transfer-of-interest-in-and-control-over-certain-highways-highway-rights-of-way-and-landings" tabindex="-1">§ 33.2-220 Transfer of interest in and control over certain highways, highway rights-of-way, and landings. <a class="header-anchor" href="#§-33-2-220-transfer-of-interest-in-and-control-over-certain-highways-highway-rights-of-way-and-landings" aria-label="Permalink to &quot;§ 33.2-220 Transfer of interest in and control over certain highways, highway rights-of-way, and landings.&quot;">​</a></h1><p>Notwithstanding any contrary provision of this title, the Board, upon receipt of a written request from a public access authority established pursuant to Title 15.2 and without first abandoning or discontinuing such highway, highway right-of-way, or landing, including a wharf, pier, or dock, may transfer to such requesting authority any and all rights and interests of the Board in a highway, highway right-of-way, or landing as the Board may deem in the public interest. Such transfer may be either with or without compensation from the requesting authority.</p><p>2007, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0304" target="_blank" rel="noreferrer">304</a>, § 33.1-223.2:17; 2011, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0667" target="_blank" rel="noreferrer">667</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0805" target="_blank" rel="noreferrer">805</a>.</p>',3),o=[n];function s(h,c,g,d,l,f){return e(),t("div",null,o)}const p=a(i,[["render",s]]);export{y as __pageData,p as default};
